import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col'; 
function Bootstrap()  {
    return(
        <>
   <Container>  
    <Row>  
     <Col class="bg-secondary p-2" md={6}>2 of 3 (wider)</Col>  
     <Col class="bg-primary p-2">1 of 3</Col>  
     <Col class="bg-danger p-2">3 of 3</Col>  
    </Row>  
    <Row>  
     <Col class="bg-success p-2">1 of 3</Col>  
     <Col class="bg-warning p-2" md={5}>2 of 3 (wider)</Col>  
     <Col class="bg-info p-2">3 of 3</Col>  
    </Row>  
   </Container>  




            
        </>
    );
}

export default Bootstrap;
